import './App.css';
import {BrowserRouter as Router ,Route} from "react-router-dom";
import Login from './components/Login';
function App() {
  return (
    <div className="App">
    <Router>
    <Route path="/login"><Login/></Route>
    </Router>
    </div>
  );
}

export default App;
